// Clockwise
const directions = ['N', 'E', 'S', 'W'];

const distanceFromOrigin = (coord) =>
	Math.abs(coord.x) + Math.abs(coord.y);

const valueBetween = (value, min, max) =>
	value >= min && value <= max;

const replaceAt = (string, index, character) =>
	`${string.substr(0, index)}${character}${string.substr(index + 1)}`;

const coordBetween = (coord, xMin, xMax, yMin, yMax) =>
	valueBetween(coord.x, xMin, xMax) && valueBetween(coord.y, yMin, yMax);

const coordMove = (coord, change) => {
	switch (change) {
		case 'U':
			coord.y--;
			break;
		case 'R':
			coord.x++;
			break;
		case 'D':
			coord.y++;
			break;
		case 'L':
		default:
			coord.x--;
			break;
	}
};

const protectCesar = (charCode) => {
	const max = 97 + 26 - 1;
	let safeCharCode = charCode;
	if (safeCharCode <= max)
		return safeCharCode;
	while (safeCharCode > max)
		safeCharCode -= 26;
	return safeCharCode;
};

const isLowerCaseLetter = (character) =>
	character >= 'a' && character <= 'z';

const getCesarMapping = (checksum) => {
	const letters = [];
	for (let i = 0 ; i < 26 ; i++) {
		const asciiCode = i + 97;
		const letter = String.fromCharCode(asciiCode);
		const destination = String.fromCharCode(protectCesar(asciiCode + checksum));

		letters.push({
			source: letter,
			destination
		});
	}
	return letters;
};

const translateWithMapping = (mapping, letter) =>
	mapping[letter.charCodeAt(0) - 97].destination;

const indexDay4 = (array, character) => {
	for (let i = 0 ; i < array.length ; i++) {
		if (array[i].character === character)
			return i;
	}
	return undefined;
};

const makeValueCorrect = (value, min, max) => {
	if (value < min)
		value = min;
	else if (value > max)
		value = max;
	return value;
};

const day1 = (input) => {
	let coord = { x: 0, y: 0 };
	let currentDirectionIndex = 0;
	let vect;

	let firstLocationVisitedTwice = null;
	const history = [{ x: 0, y: 0 }];

	const steps = input.split(',').map((step) => step.trim());
	steps.map((step) => {
		const letter = step[0];
		const number = parseInt(step.substring(1), 10);
		const directionChange = letter === 'L' ? -1 : 1;
		currentDirectionIndex += directionChange;
		currentDirectionIndex = (currentDirectionIndex + directions.length) % directions.length;

		switch (directions[currentDirectionIndex]) {
			case 'N':
				vect = { x: 0, y: -1 };
				break;
			case 'E':
				vect = { x: 1, y: 0 };
				break;
			case 'S':
				vect = { x: 0, y: 1 };
				break;
			case 'W':
			default:
				vect = { x: -1, y: 0 };
				break;
		}

		for (i = 0 ; i < number ; i++) {
			coord.x += vect.x;
			coord.y += vect.y;

			if (!firstLocationVisitedTwice) {
				history.map((historyLine) => {
					if (historyLine.x === coord.x && historyLine.y === coord.y) {
						firstLocationVisitedTwice = { ...coord };
					}
				});
			}

			history.push({ ...coord });
		}
	});

	const part2 = firstLocationVisitedTwice
		? distanceFromOrigin(firstLocationVisitedTwice)
		: 0;

	return {
		part1: distanceFromOrigin(coord),
		part2
	};
};

const day2 = (input) => {
	const pads = [
		[
			[1, 2, 3],
			[4, 5, 6],
			[7, 8, 9]
		],
		[
			[null, null, 1, null, null],
			[null, 2, 3, 4, null],
			[5, 6, 7, 8, 9],
			[null, 'A', 'B', 'C', null],
			[null, null, 'D', null, null]
		]
	];
	const codes = [[], []];
	let coords = [
		{ x: 1, y: 1 },
		{ x: 0, y: 2 }
	];
	const steps = input.split(',');
	steps.forEach((step) => {
		for (let i = 0; i < step.length; i++) {
			const letter = step.charAt(i);
			copyCoord = { ...coords[1] };

			[0, 1].forEach((index) =>
				coordMove(coords[index], letter)
			);

			['x', 'y'].forEach((axis) =>
				coords[0][axis] = makeValueCorrect(coords[0][axis], 0, 2)
			);

			if (!coordBetween(coords[1], 0, 4, 0, 4) || !pads[1][coords[1].y][coords[1].x]) {
				coords[1] = { ...copyCoord };
			}
		}
		[0, 1].forEach((index) => {
			codes[index].push(pads[index][coords[index].y][coords[index].x]);
		});
	});

	return {
		part1: parseInt(codes[0].join(''), 10),
		part2: codes[1].join('')
	};
};

const sanitizeTupleDay3 = (tuple) =>
	tuple.split(' ').map((v) => parseInt(v, 10));

const day3 = (input) => {
	const tuples = input.split(',');
	let validTuples = 0;
	tuples.forEach((tuple) => {
		const values = sanitizeTupleDay3(tuple);
		const sortedValues = sortBy(values);
		if (sortedValues[0] + sortedValues[1] > sortedValues[2])
			validTuples++;
	});

	let validVerticalTuples = 0;
	for (let i = 0 ; i < tuples.length ; i += 3) {
		[0, 1, 2].forEach((column) => {
			const values = [
				sanitizeTupleDay3(tuples[i])[column],
				sanitizeTupleDay3(tuples[i + 1])[column],
				sanitizeTupleDay3(tuples[i + 2])[column],
			];
			const sortedValues = sortBy(values);
			if (sortedValues[0] + sortedValues[1] > sortedValues[2])
				validVerticalTuples++;
		});
	}

	return {
		part1: validTuples,
		part2: validVerticalTuples
	};
};

const day4 = (input) => {
	let sum = 0;
	let part2;
	let checkSumPart2 = -1;
	input.forEach((line) => {
		const openingBracket = line.indexOf('[');
		const closingBracket = line.indexOf(']');
		const checksum = line.substring(openingBracket + 1, closingBracket);
		const name = line.substring(0, openingBracket);
		const lastDash = line.lastIndexOf('-');
		const shortName = line.substring(0, lastDash);
		const id = openingBracket !== -1
			? parseInt(line.substring(lastDash + 1, openingBracket), 10)
			: parseInt(line.substring(lastDash + 1), 10);
		const mapping = getCesarMapping(id);

		const informationLetters = [];
		for (let i = 0; i < name.length ; i++) {
			const character = name[i];

			if (isLowerCaseLetter(character)) {
				const indexInArray = indexDay4(informationLetters, character);
				if (indexInArray === undefined) {
					informationLetters.push({
						character,
						occurrences: 1,
						order: informationLetters.length + 1
					});
				} else {
					informationLetters[indexInArray].occurrences++;
				}
			}
		}
		const correctInfo = orderBy(informationLetters, ['occurrences', 'character'], ['desc', 'asc']);
		let correct = true;
		for (let i = 0; i < checksum.length ; i++) {
			const character = checksum[i];
			if (correctInfo[i].character !== character)
				correct = false;
		}
		if (correct) sum += id;

		// Part 2
		const tempName = shortName.replace(/-/g, ' ');
		part2 = [];
		for (let i = 0; i < tempName.length ; i++) {
			const character = tempName[i];
			if (isLowerCaseLetter(character)) {
				part2[i] = translateWithMapping(mapping, character);
			} else {
				part2[i] = tempName[i];
			}
		}
		if (part2.join('').toLowerCase().includes('north'))
			checkSumPart2 = id;
	});

	return {
		part1: sum,
		part2: checkSumPart2 !== -1 ? checkSumPart2 : part2.join('')
	}
};

const day5 = (input, partNumber = null) => {
	const code = [];
	let code2 = '12345678';
	const prefix = '00000';

	if (!partNumber || partNumber === 1) {
		let id = 0;
		while (code.length < 8) {
			const hash = md5(`${input}${id}`);
			if (hash.startsWith(prefix)) {
				code.push(hash[5]);
			}
			id++;
		}
	}

	if (!partNumber || partNumber === 2) {
		let id = 0;
		const completedPositions = [];

		while (!(completedPositions.length === 8)) {
			const hash = md5(`${input}${id}`);
			const pos = parseInt(hash[5], 10);
			if (hash.startsWith(prefix) && valueBetween(pos, 0, 7) && !completedPositions.find((cPos) => cPos === pos)) {
				completedPositions.push(pos);
				code2 = replaceAt(code2, pos, hash[6]);
			}
			id++;
		}
	}

	return {
		part1: code.join(''),
		part2: code2
	}
};

